INSERT INTO `kampf` (`id`, `gebiet_id`, `log`) VALUES
	(201, NULL, '<font color=\'green\'>Gewonnen</font><br><font color=\'red\'>Ratte stirbt im Kampf.</font><br>Ratte: -8 Gesundheit durch Biss<br>Rashiel greift Ratte erfolgreich mit Biss an.<br><br>Ratte greift Rashiel mit Biss an. Rashiel kann dem Angriff jedoch ausweichen.<br>Ratte: -7 Gesundheit durch Schlag<br>Rashiel greift Ratte erfolgreich mit Schlag an.<br><br>Rashiel: -5 Gesundheit durch Biss<br>Ratte greift Rashiel erfolgreich mit Biss an.<br>Ratte patzt Ausführen von Biss auf Rashiel.<br>Rashiel greift Ratte mit Biss an. Ratte kann dem Angriff jedoch ausweichen.<br><br>Ratte: -7 Gesundheit durch Schlag<br>Ratte: 0 Intelligenz durch Beendigung von Alkohol<br>Rashiel greift Ratte erfolgreich mit Schlag an.<br><br>Rashiel: -5 Gesundheit durch Biss<br>Ratte greift Rashiel erfolgreich mit Biss an.<br><br>Rashiel: -5 Gesundheit durch Biss<br>Ratte patzt Ausführen von Biss auf Rashiel.<br>Ratte: -0 Gesundheit durch Alkohol<br>Ratte greift Rashiel erfolgreich mit Biss an.<br>Ratte: -0 Gesundheit durch Alkohol<br>Ratte: -0 Intelligenz durch Alkohol<br>Rashiel wendet den Zauber Alkohol erfolgreich auf Ratte an.<br><br>'),
