INSERT INTO `zauber_text` (`id`, `name`, `ziel_falsch_kurz`, `ziel_falsch_standard`, `ziel_tot_kurz`, `ziel_tot_standard`, `zauberpunkte_kurz`, `zauberpunkte_standard`, `patzer_kurz`, `patzer_standard`, `ausweichen_kurz`, `ausweichen_standard`, `abwehr_kurz`, `abwehr_standard`, `erfolg_kurz`, `erfolg_standard`) VALUES
	(1, 'Standardzauber', '§zaubernder (§zauber) -> §zauberziel (Zielfehler)', '§zaubernder will den Zauber §zauber auf §zauberziel anwenden und stellt dabei fest, dass das nicht sinnvoll wäre.', '§zaubernder (§zauber) -> §zauberziel (Ziel tot)', '§zaubernder will den Zauber §zauber auf §zauberziel anwenden und stellt dabei fest, dass das Ziel bereits tot ist.', '§zaubernder (§zauber) -> §zauberziel (Zauberpunkte)', '§zaubernder will den Zauber §zauber auf §zauberziel anwenden, verfügt aber nicht über genügend Zauberpunkte.', '§zaubernder (§zauber) -> §zauberziel (Patzer)', '§zaubernder patzt beim Zaubern von §zauber auf §zauberziel.', '§zaubernder (§zauber) -> §zauberziel (ausgewichen)', '§zaubernder zaubert §zauber auf §zauberziel. §zauberziel kann dem Zauber jedoch ausweichen.', '§zaubernder (§zauber) -> §zauberziel (abgewehrt)', '§zaubernder zaubert §zauber auf §zauberziel. §zauberziel kann den Zauber jedoch abwehren.', '§zaubernder (§zauber) -> §zauberziel', '§zaubernder zaubert erfolgreich §zauber auf §zauberziel.'),
	(2, 'Standardangriff', '§zaubernder (§zauber) -> §zauberziel (Zielfehler)', '§zaubernder will §zauberziel mit §zauber angreifen und stellt dabei fest, dass das nicht sinnvoll wäre.', '§zaubernder (§zauber) -> §zauberziel (Ziel tot)', '§zaubernder will §zauberziel mit §zauber angreifen und stellt dabei fest, dass das Ziel bereits tot ist.', '§zaubernder (§zauber) -> §zauberziel (Zauberpunkte)', 'Einen Angriff mit Zauberpunkteverbrauch dürfte es nicht geben.', '§zaubernder (§zauber) -> §zauberziel (Patzer)', '§zaubernder patzt beim Ausführen von §zauber auf §zauberziel.', '§zaubernder (§zauber) -> §zauberziel (ausgewichen)', '§zaubernder greift §zauberziel mit §zauber an. §zauberziel kann dem Angriff jedoch ausweichen.', '§zaubernder (§zauber) -> §zauberziel (abgewehrt)', '§zaubernder greift §zauberziel mit §zauber an. §zauberziel kann den Angriff jedoch abwehren.', '§zaubernder (§zauber) -> §zauberziel', '§zaubernder greif §zauberziel erfolgreich mit §zauber an.');
